<script>
  // Link leaves to actual diffs on GitHub
  function showOnGithub(d) {
    const url = "https://github.com/weliveindetail/llvm-project/compare/fd1d8c2f04dde23bee0fb3a7d069a9b1046da979..e50495623e5c690c69ab107ed01a1368f0dd0445#diff-";
    const relPath = concatPath(d).slice(12 + 1); // account for slash
    window.open(url + sha256(relPath), '_blank');
  }
  baobab.arcShapes
    .filter(d => !d.children)
    .style("cursor", "pointer")
    .on("click", d => showOnGithub(d));

  // Highlight all arcs on hover
  function setOpacity(d, percent) {
    d.style("fill-opacity", percent);
  }
  baobab.arcShapes
    .on("mouseover", function() { setOpacity(d3.select(this), 0.75); })
    .on("mouseout", function() { setOpacity(d3.select(this), 1); });
</script>

<script>
(function() {
  var regex = /[?&]([^=#]+)=([^&#]*)/g,
      url = window.location.href,
      params = {},
      match;
  while(match = regex.exec(url)) {
    params[match[1]] = match[2];
  }

  if (params["path"]) {
    var path = params["path"].split("/");
    var select = baobab.root;
    for (var i = 1; i < path.length; i++) {
      const child = select.children.find(node => node.data["n"] == path[i]);
      if (child && child["children"])
        select = child
      else
        break;
    }
    selectAsNewRoot(select);
  }
})();
</script>
